def shortestPalindrome(s):
    """
    :type s: str
    :rtype: str
    """
    if len(s)==0:
        return ""
    s = list(s)
    result = [i for i in s]
    maxRight = 0
    palinFound = False
    for i in range(len(s)/2,0,-1):
        flag, right = isPalin(s,i)
        if flag:
            palinFound = True
            maxRight = right
            break
    #print palinFound,maxRight,s,result
    if palinFound:
        for i in range(maxRight+1,len(s)):
            result.insert(0,s[i])
    else:
        for i in range(1,len(s)):
            result.insert(0,s[i])
            #print i,result
    result = "".join(result)
    return result

def isPalin(s,mid):
    left = mid
    right = mid
    while left>=0 and right<len(s) and s[left]==s[right]:
        left -= 1
        right += 1
    if left == -1:
        return True, right-1
    return False, -1

